import style from "./loginForm.module.css";

const LoginForm = () => {
  return (
    <div>
      <div>Войдите в аккаунт</div>
      <div>Зарегистрируйстесь если у вас нет аккаунта</div>
      <div><button>Регистрация</button></div>
    </div>
  );
};

export default LoginForm;
